import React from 'react';
import './Solution.css';

const Solution = () => {
  return (
    <section className="project-info-section">
      <div className="project-info-container">
        <h2>Про наш проект: інтерактивне відкриття історії України</h2>
        <p>
          Тут йде текст опису проекту. Це може бути розповідь про основну ідею, 
          місію проекту або деталі про те, як цей проект допомагає краще 
          зрозуміти історію України за допомогою сучасних технологій.
        </p>
      </div>
    </section>
  );
};

export default Solution;
